import React from "react";

import gitHub from "../images/footer/GitHub.svg";
import linkedIn from "../images/footer/LinkedIn.svg";
import logo from "../images/footer/logo_dark.svg";

const Footer = () => {
  return (
    <footer className="footer">
      <ul>
        <li>
          <a href="https://www.linkedin.com/in/anton-guliaev-3071a3215/">
            <img src={linkedIn} alt="LinkedIn logo" />
          </a>
        </li>
        <li>
          <a href="https://www.nmkzzztos.de">
            <img src={logo} alt="Nmkzzztos logo" />
          </a>
        </li>
        <li>
          <a href="https://github.com/nmkzzztos">
            <img src={gitHub} alt="GitHub logo" />
          </a>
        </li>
      </ul>
    </footer>
  );
};

export default Footer;
